// 復号
function decrypt(code, pass) {
    // AESキーの生成(128bit、5万回)
    const key = CryptoJS.PBKDF2(pass, salt, {
        keySize: 128 / 32,
        iterations: 50000,
        hasher: CryptoJS.algo.SHA256,
    });

    // AESキーで復号
    const decrypted = CryptoJS.AES.decrypt(code, key, {
        iv: iv,
    });

    return decrypted.toString(CryptoJS.enc.Utf8);
}

